import React, { Component } from 'react';
import './PlanningCards.css'

class PlanningCards extends Component {
  render() {
    return (
      <div className="planningCardGrid">
        <div className="planningCard">
          <h3>Conventional</h3>
        </div>
        <div className="planningCard">
          <h3>Issue-Based</h3>
        </div>
        <div className="planningCard">
          <h3>Organic</h3>
        </div>
        <div className="planningCard">
          <h3>Alignment</h3>
        </div>
        <div className="planningCard">
          <h3>Custom</h3>
        </div>
      </div>
    );
  }
}

export default PlanningCards;
